import React from 'react';
import './Header.css';
import logo from './logo.png'
import { Link } from 'react-router-dom';


const Header = () => {
  return (
    <nav>
      <Link to="/">Главная</Link>
      <Link to="/about">О нас</Link>
    </nav>
  );
};

export default Header;
